<li><p><strong>Chikungunya</strong> : Mayotte a besoin de plein de
choses en ce moment, des bras, des fonds, du matériel, des médicaments,
des vêtements, de la nourriture, des constructions rapides et pérennes.
Ce dont Mayotte n’a vraiment pas besoin en revanche, c’est d’une
nouvelle épidémie. L’agence de lutte antivectorielle s’est ainsi
déployée après la découverte d’un cas de chikungunya importé de la
Réunion, détruisant tous les sites de pontes potentiels à proximité du
domicile de la patiente, traitant les proches, formant les voisins à
l’élimination des sites de gîte larvaire des moustiques et distribuant
du matériel de protection contre les piqûres. L’ARS de Mayotte a annoncé
rester pour l’instant au niveau 1B du plan ORSEC, mais toute l’île est
sous haute surveillance.</p></li>
